// App.js

import React from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Button, View, Text } from "react-native";

import Home from "./screens/Home";
import Fitnessplan from "./screens/Fitnessplan";
import Fitnessinfo from "./screens/Fitnessinfo";
import Login from "./screens/Login";

const Stack = createStackNavigator();

function NavStack() {
  return (
    <Stack.Navigator
      screenOptions={{
        headerTitleAlign: "center",
        headerStyle: {
          backgroundColor: "#621FF7",
        },
        headerTintColor: "#fff",
        headerTitleStyle: {
          fontWeight: "bold",
        },
      }}
    >
      <Stack.Screen
        name="Home"
        component={Home}
        options={{
          title: "Home",
          headerRight: (
            <Button onPress={() => navigation.navigate("Fitnessplan")} />
          ),
        }}
      />
      <Stack.Screen
        name="Fitnessplan"
        component={Fitnessplan}
        options={{ title: "Fitnessplan" }}
      />
      <Stack.Screen
        name="Fitnessinfo"
        component={Fitnessinfo}
        options={{ title: "Fitnessinfo" }}
      />
      <Stack.Screen
        name="Login"
        component={Login}
        options={{ title: "Login" }}
      />
    </Stack.Navigator>
  );
}

export default function App(navigation) {
  return (
    <NavigationContainer>
      <NavStack />
    </NavigationContainer>
  );
}
